import{_ as e,o as t,c as o,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 6.2-1900 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-1900.md","filePath":"vacode/6.2-1900.md"}'),r={name:"vacode/6.2-1900.md"},i=n('<h1 id="§-6-2-1900-definitions" tabindex="-1">§ 6.2-1900 Definitions. <a class="header-anchor" href="#§-6-2-1900-definitions" aria-label="Permalink to &quot;§ 6.2-1900 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Authorized delegate&quot; means a person designated or appointed by a licensee to sell money orders or provide money transmission services on behalf of the licensee.</p><p>&quot;Licensee&quot; means a person licensed under this chapter to engage in the business of selling money orders or the business of money transmission, or both.</p><p>&quot;Member&quot; means a person who owns or controls a 10 percent or greater interest in a limited liability company.</p><p>&quot;Monetary value&quot; means a medium of exchange, whether or not redeemable in money.</p><p>&quot;Money order&quot; means a check, traveler&#39;s check, draft, or other instrument for the transmission or payment of money or monetary value whether or not negotiable.</p><p>&quot;Money order seller&quot; means a person engaged in the business of selling money orders.</p><p>&quot;Money transmission&quot; means receiving money or monetary value for transmission by wire, facsimile, electronic means or other means or selling or issuing stored value.</p><p>&quot;Money transmitter&quot; means a person engaged in the business of money transmission.</p><p>&quot;Nationwide Multistate Licensing System and Registry&quot; or &quot;Registry&quot; means the licensing and registration system operated by the State Regulatory Registry LLC.</p><p>&quot;Outstanding&quot; means:</p><ol><li><p>With respect to a money order, a money order that has been issued and sold directly by a licensee, or sold by an authorized delegate of the licensee and reported to the licensee, that has not yet been paid by or on behalf of the licensee; or</p></li><li><p>With respect to a money transmission transaction, a money transmission transaction for which the licensee, directly or through an authorized delegate of the licensee, has received money or monetary value from a customer for transmission, but has not yet (i) completed the money transmission transaction by delivering the money or monetary value to the person designated by the customer, or (ii) refunded the money or monetary value to the customer.</p></li></ol><p>&quot;Principal&quot; means any person who, directly or indirectly, owns or controls a 10 percent or greater interest in any form of entity.</p><p>&quot;Stored value&quot; means monetary value that is evidenced by an electronic record.</p><p>1974, c. 578, § 6.1-370; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0889" target="_blank" rel="noreferrer">889</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0010" target="_blank" rel="noreferrer">10</a>; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0372" target="_blank" rel="noreferrer">372</a>; 2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0346" target="_blank" rel="noreferrer">346</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0454" target="_blank" rel="noreferrer">454</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0634" target="_blank" rel="noreferrer">634</a>.</p>',16),a=[i];function s(l,c,p,h,d,m){return t(),o("div",null,a)}const f=e(r,[["render",s]]);export{g as __pageData,f as default};
